    <style>
        body {
            margin: 0;
            height: 100vh;
            background: url("images/fond-carbone.png") center center no-repeat;
            background-size: cover;
            font-family: 'Orbitron', sans-serif;
            color: #c0c0c0;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            user-select: none;
            -webkit-user-drag: none;
        }

        img {
            max-width: 300px;
            height: auto;
            pointer-events: none;
            -webkit-user-drag: none;
        }

        p {
            margin-top: 30px;
            font-size: 2.2rem;
            letter-spacing: 3px;
            text-transform: uppercase;
            text-shadow: 1px 1px 3px rgba(0, 0, 0, 0.6);
        }
    </style>
    <script>
        // Désactive le clic droit
        document.addEventListener('contextmenu', event => event.preventDefault());

        // Bloque le drag & drop
        document.addEventListener('dragstart', event => event.preventDefault());

        // Bloque certains raccourcis clavier
        document.addEventListener('keydown', function(e) {
            if (e.ctrlKey && ['s', 'u', 'c'].includes(e.key.toLowerCase())) {
                e.preventDefault();
            }
        });
    </script>
</head>
    <script>
  document.addEventListener('contextmenu', function(e) {
    e.preventDefault();
    alert("Clic droit désactivé sur ce site.");
  });

  document.addEventListener('dragstart', function(e) {
    e.preventDefault();
    alert("Glisser-déposer désactivé.");
  });

  document.addEventListener('keydown', function(e) {
    if (e.ctrlKey && ['s', 'u', 'c'].includes(e.key.toLowerCase())) {
      e.preventDefault();
      alert("Raccourci désactivé.");
    }
  });
</script>
